    let modal = document.getElementsByClassName('modal')[0];
    modal.style.display = 'block';
}

const AdminItem = () => {
    const [type, setType] = useState('full time');
    const [category, setCategory] = useState('');

    const closeModal = () => {
        let modal = document.getElementsByClassName('modal')[0];
        modal.style.display = 'none';
    }

    return (
        <>
            <AdminCategory />
            <AdminCustomCompany />
            <AdminCustomJob />
        </>
    )
}

